import React from "react";

const Form = () => {
  return (
    <div>
      <form className="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4 flex flex-col">
        <label htmlFor="firstName">First Name</label>
        <input
          type="text"
          name="firstName"
          id="firstName"
          className="border-2"
        />
        <label htmlFor="firstName">Last Name</label>
        <input
          type="text"
          name="lasstName"
          id="lastName"
          className="border-2"
        />
      </form>
    </div>
  );
};

export default Form;
